import React from 'react';
import { useTheme } from '../../context/ThemeContext';
import { ReactComponent as SunIcon } from '../../assets/icons/sun-icon.svg';
import { ReactComponent as MoonIcon } from '../../assets/icons/moon-icon.svg';
import './Navigation.css';

const Navigation = () => {
  const { isDarkMode, toggleDarkMode, showModal } = useTheme();

  return (
    <nav className="navigation">
      <div className="logo">TechSaaS Vision</div>
      <div className="nav-items">
        <button onClick={toggleDarkMode} className="toggle-button">
          {isDarkMode ? <SunIcon /> : <MoonIcon />}
        </button>
        <button onClick={showModal} className="theme-switch-button">
          Switch Theme
        </button>
      </div>
    </nav>
  );
};

export default Navigation;
